a:17:{s:4:"name";s:21:"Cenforce Professional";s:11:"small_descr";s:143:"Cenforce Professional is an extra-strength prescription medicine. It starts acting faster and the effect lasts longer that with regular Viagra.";s:14:"small_descr_de";s:142:"Cenforce Professional ist eine extra starke Medizin. Sie beginnt schneller zu wirken und ihr Effekt dauert länger, als bei der Viagra regular";s:14:"small_descr_fr";s:127:"Cenforce Professional est une médecine de prescription d'extra-force. Il commence à agir plus vite et l'effet dure plus long.";s:14:"small_descr_es";s:234:"Cenforce Professional es una medicación de eficacia superbe que viene con bajo la prescripción de médico. Se empieza a funcionar y demostrar el efecto más rápidamente y lo mantiene para más largo tiempo que un Cenforce habitual.";s:14:"small_descr_it";s:158:"Cenforce Professional è una prescrizione extra-forte medicina. Si comincia ad agire più rapidamente e l'effetto dura più a lungo che, con regolare Cenforce";s:10:"full_descr";s:3784:"<p><strong>Common use<br /></strong><br /> Sildenafil Citrate is the main component of Cenforce Professional. <br /> Sildenafil Citrate affects the response to sexual stimulation. It acts by enhancing smooth muscle relaxation using nitric oxide, a chemical that is normally released in response to sexual stimulation. This smooth muscle relaxation allows increased blood flow into certain areas of the penis, which leads to an erection.<br /> Sildenafil Citrate is applied for the treatment of erectile dysfunction (impotence) in men and pulmonary arterial hypertension. <br /> Sildenafil Citrate may also be used for other purposes not listed above. <br /><br /><strong> Dosage and direction</strong><br /><br /> Cenforce Professional is taken approximately 15-20 minutes before sexual activity. Do not take Cenforce&nbsp;more then once a day.<br /> A high fat meal may delay the time of the effect of this drug.<br /> Try not to eat grapefruit or drink grapefruit juice while you are being treated with Sildenafil Citrate .<br /><br /> <strong>Precautions<br /></strong><br /> Before you start taking Sildenafil Citrate, tell your doctor or pharmacist if you are allergic to it; or if you have any other allergies.<br /> Aged people may be more sensitive to the side effects of the drug.<br /><br /> <strong>Contraindications<br /></strong><br /> Cenforce Professional is contraindicated in patients taking another medicine to treat impotence or using a nitrate drug for chest pain or heart problems. <br /> This medicine should not be taken by women and children as well as in patients with a known hypersensitivity to any component of the tablet.<br /><br /> <strong>Possible side effect <br /></strong><br /> The most common side effects are headache, flushing, heartburn, stomach upset, nasal stuffiness, lightheadedness, dizziness or diarrhea.<br /> A serious allergic reaction to this drug is very rare, but seek immediate medical help if it occurs. <br /> Many people who use this medicine do not have serious side effects. <br /> In case you notice any side effects not listed above, contact your doctor or pharmacist. <br /><br /> <strong>Drug interaction <br /></strong><br /> This drug should not be used with nitrates and recreational drugs called "poppers" containing amyl or butyl nitrite; alpha-blocker medications; other medications for impotence; high blood pressure medicines, etc.<br /> Consult your doctor or pharmacist for more details.<br /><br /> <strong>Missed dose<br /></strong><br /> Cenforce Professional is used as required, so you are unlikely to be on a dosing schedule.<br /><br /> <strong>Overdose<br /></strong><br /> If you think you have used too much of this medicine, seek emergency medical attention right away. The symptoms of overdose usually include chest pain, nausea, irregular heartbeat, and feeling light-headed or fainting.<br /><br /> <strong>Storage<br /></strong><br /> Store your medicines at room temperature between 68-77 degrees F (20-25 degrees C) away from light and moisture. Do not store the drugs in the bathroom. Keep all drugs away from reach of children and pets.<br /><br /> <strong>Disclaimer<br /></strong><br /> We provide only general information about medications which does not cover all directions, possible drug integrations, or precautions. Information at the site cannot be used for self-treatment and self-diagnosis. Any specific instructions for a particular patient should be agreed with your health care adviser or doctor in charge of the case. We disclaim reliability of this information and mistakes it could contain. We are not responsible for any direct, indirect, special or other indirect damage as a result of any use of the information on this site and also for consequences of self-treatment.</p>";s:13:"full_descr_de";s:4711:"<p><strong>Allgemeine Anwendung<br /></strong><br />&nbsp;Sildenafil ist der Hauptbestandteil von Cenforce&nbsp;Professional.&nbsp;<br /> Sildenafil beeinflusst die Reaktion zur sexuellen Anregung. Das wirkt auf die Entspannung der glatten Muskeln mit der Benutzung von Stickstoffoxid, einer Chemikalie, die normalerweise die Reaktion f&uuml;r sexuelle Anregung befreit. Diese Entspannung erlaubt erh&ouml;hten Blutfluss in die bestimmten Bereiche von Penis, und das f&uuml;hrt zur Aufrichtung. Sildenafil verwendet man f&uuml;r die Behandlung der Funktionsst&ouml;rung (Machtlosigkeit) bei den M&auml;nnern, sowie bei dem arteriellen Lungenbluthochdruck. Sildenafil kann f&uuml;r andere Zwecke auch verwendet werden, die nicht oben verzeichnet wurden.<br /><br /> <strong>Dosierung und Anwendungsgebiet:<br /></strong><br /> Cenforce Professional muss bei der Notwendigkeit genommen werden, ungef&auml;hr 15-20 Minuten vor dem Geschlechtsverkehr. Nehmen Sie Cenforce&nbsp;Professional nicht &ouml;fter als einmal t&auml;glich. Eine fettreiche Mahlzeit kann die Zeit des Effektes dieser Droge verz&ouml;gern. Versuchen Sie, Grapefruit nicht zu essen oder Grapefruitsaft nicht zu trinken, w&auml;hrend Sie mit Sildenafil behandelt werden.<br /><br /> <strong>Vorsichtsma&szlig;nahmen<br /></strong><br /> bevor Sie anfangen, Sildenafil zu nehmen, informieren Sie Ihren Doktor oder Apotheker, wenn Sie dazu allergisch sind; oder wenn Sie irgendwelche anderen Allergien haben. Gealterte Leute k&ouml;nnen f&uuml;r die Nebenwirkungen der Droge empfindlicher sein.<br /><br /> <strong>Kontraindikationen<br /></strong><br /> Cenforce Professional ist f&uuml;r jene Patienten nicht angezeigt, die eine andere Medizin gegen Impotenz einnehmen oder Nitrate haltige Arzneien gegen Brustschmerzen oder Herzprobleme verwenden. Diese Medizin sollte nicht von den Frauen und von den Kindern genommen werden, sowie von den Patienten mit einer bekannten &Uuml;berempfindlichkeit zu irgendeinem Bestandteil der Tablette, <br /><br /> <strong>M&ouml;gliche Nebenwirkung<br /> </strong><br /> die m&ouml;glichst oft auftretenden Nebenwirkungen sind Kopfschmerzen, Flushing , Magenverstimmung, Verstopfte oder laufende Nase , Gedankenlosigkeit, &Uuml;belkeit oder Diarrh&ouml;e. Die ernste allergische Reaktion auf diese Medizin kann sehr selten auftreten und in diesem Fall brauchen Sie sofortige medizinische Hilfe. Viele Menschen benutzen diese Medizin ohne ernste Nebenwirkungen. Diese Aufz&auml;hlung kann unvollst&auml;ndig sein. Treten Sie mit Ihrem Doktor oder mit dem Apotheker in Verbindung. <br /><br /> <strong>Wechselwirkung <br /></strong><br /> diese Medizin soll nicht mit den Nitraten und entspannenden Arzneimitteln verwendet werden, die poppers genannt werden, und Amyl- oder Butylnitrit enthalten; sowie Alphablockierer Arzneimitteln; andere Medikationen gegen Impotenz; Bestimmte Medikamente gegen Bluthochdruck, etc. Treten Sie mit Ihrem Doktor oder Apotheker f&uuml;r mehr Details in Verbindung.<br /><br /> <strong>Verpasste Dosis<br /></strong><br /> Sie m&uuml;ssen diese Medizin nur bei der Notwendigkeit einnehmen, und brauchen keinen Plan f&uuml;r die Einnahme.<br /><br /> <strong>&Uuml;berdosierung <br /></strong><br /> Wenn Sie denken, Sie haben zu viel Medizin eingenommen, treten sofort mit Ihrem Arzt in die Verbindung! Symptome f&uuml;r die &Uuml;berdosierung k&ouml;nnen wir folgt sein: Brustschmerzen , &Uuml;belkeit, unregelm&auml;&szlig;iger Herzschlag, Ohnmacht<br /><br /> <strong>Lagerung<br /></strong><br /> Lagern bei einer Zimmertemperatur zwischen 68-77 G (20 und 25 Grad Celsius). Bewahren Sie die Medizin in dem Badezimmer nicht.<br /> Au&szlig;er Reichweite von Kindern und Haustiere! <br /> Sch&uuml;tzen vor Feuchte und Tageslicht!<br /><br /> <strong>Haftung</strong><br /><br /> Wir stellen Ihnen nur die allgemeine Information &uuml;ber die Medizin zur Verf&uuml;gung vor, die nicht alle Anweisungen, m&ouml;glichen Wechselwirkungen oder Vorsichtma&szlig;nahmen umfasst. Die Information, die auf dieser Seite ausgestellt ist kann nicht f&uuml;r die Selbstbehandlung oder f&uuml;r die Eigendiagnostik verwendet werden. Alle Anweisungen f&uuml;r einen bestimmten Patienten sollen mit Ihrem Gesundheitspflegeberater oder Doktor, der f&uuml;r den Fall verantwortlich ist, &uuml;bereingestimmt werden. <br /> Wir m&uuml;ssen jede Haftung f&uuml;r Sch&auml;den ablehnen, die aus einer missbr&auml;uchlichen Nutzung von den Informationen auf dieser Seite entstehen kann.<br /> Wir sind nicht f&uuml;r direkte, indirekte, spezielle oder andere indirekte Besch&auml;digung irgendwelcher Art, sowie auch f&uuml;r Folgen Ihrer m&ouml;glichen Selbstbehandlung nicht verantwortlich.</p>";s:13:"full_descr_fr";s:5029:"<p><strong>Usage g&eacute;n&eacute;ral<br /></strong><br /> Sildenafil est la composante principale de Cenforce Professional. <br /> Sildenafil affecte la r&eacute;ponse &agrave; la stimulation sexuelle. <br /> Ce m&eacute;dicament est utilis&eacute; pour traiter le dysfonction &eacute;rectile (l'impuissance) chez les hommes et pour le traitement d'hypertension art&eacute;rielle pulmonaire. <br /> Sildenafil peut aussi &ecirc;tre utilis&eacute; pour les autres buts. <br /><br /> <strong>Dosage et administration <br /></strong><br /> Cenforce Professional est pris par la bouche comme n&eacute;cessaire environ 15-20 minutes avant l'activit&eacute; sexuelle. Sildenafil ne doit pas &ecirc;tre pris plus qu'une fois par jour. <br /> Un repas gros peut retarder le temps de commencement de ce m&eacute;dicament. <br /> &Eacute;vitez de manger le pamplemousse ou boire du jus de pamplemousse pendant que l'on vous traite avec cette m&eacute;dication. <br /><br /> <strong>Pr&eacute;cautions <br /></strong><br /> Avant de prendre Cenforce Professional, dites &agrave; votre docteur ou pharmacien si vous &ecirc;tes allergiques &agrave; Sildenafil; ou si vous avez autres allergies. <br /> Les personnes &acirc;g&eacute;es peuvent &ecirc;tre plus sensibles aux Effets secondaires possibles du m&eacute;dicament. <br /><br /> <strong>Contre-indications <br /></strong><br /> Cenforce Professional est contre-indiqu&eacute; chez les patients prenant une autre m&eacute;decine pour traiter l'impuissance ou utilisant un m&eacute;dicament de nitrate. <br /> Cette m&eacute;dication ne doit pas &ecirc;tre utilis&eacute;e par les femmes ou les enfants aussi que par les patients ayant manifest&eacute; une r&eacute;action d'hypersensibilit&eacute; au Sildenafil. <br /><br /><strong> Effets secondaires possibles <br /></strong><br /> Les Effets secondaires possibles possibles sont fatigue excessive, naus&eacute;e ou vomissements, jaunissement des yeux ou de la peau, diminution d'app&eacute;tit, diarrh&eacute;e, bouff&eacute;es de chaleur, etc. <br /> Beaucoup de personnes utilisant cette m&eacute;dication n'ont pas d'Effets secondaires possibles s&eacute;rieux. <br /> Votre m&eacute;decin traitant a prescrit cette m&eacute;dication parce que l'avantage &agrave; vous est plus grand que le risque d'Effets secondaires possibles. <br /> Une r&eacute;action allergique tr&egrave;s s&eacute;rieuse &agrave; ce m&eacute;dicament va improbable, mais chercher l'attention m&eacute;dicale imm&eacute;diate s'il se produit. <br /> Contactez votre m&eacute;decin traitant ou pharmacien pour plus de d&eacute;tails. <br /><br /> <strong>Interaction des m&eacute;dicaments <br /></strong><br /> Ce m&eacute;dicament ne doit pas &ecirc;tre utilis&eacute; avec les nitrates et les m&eacute;dicaments r&eacute;cr&eacute;atifs appel&eacute;s "des pressions" contenant de l'amyle ou du butyle nitrite; m&eacute;dications alpha-bloquants; d'autres m&eacute;dications pour l'impuissance; m&eacute;decines d'hypertension, etc. <br /> Consultez votre m&eacute;decin traitant ou pharmacien pour plus de d&eacute;tails. <br /><br /> <strong>Omission de dose <br /></strong><br /> Cenforce Professional est utilis&eacute; comme n&eacute;cessaire, donc vous ne serez pas probablement sur un programme de dosage. <br /><br /> <strong>Surdosage <br /></strong><br /> Cherchez l'attention de secours d'urgence si vous croyez que vous avez utilis&eacute; trop de cette m&eacute;decine. Les sympt&ocirc;mes d'overdose peuvent inclure : la nervosit&eacute; suant, extr&ecirc;me excessive, le battement de coeur rapide/irr&eacute;gulier, la douleur de poitrine, les saisies. <br /><br /> <strong>Conservation <br /></strong><br /> Garder &agrave; la temp&eacute;rature ambiante entre 15 et 30 degr&eacute;s Celsius (59 et 86 degr&eacute;s Fahrenheit). Entreposer le contenant bien ferm&eacute; hors de la port&eacute;e des enfants. <br /> Ne conservez pas vos medicaments dans la salle de bains.<br /><br /> <strong>Disclaimer (avis de non responsabilit&eacute;)<br /></strong><br />&nbsp;Nous fournissons des renseignements &agrave; caract&egrave;res uniquement g&eacute;n&eacute;raux sur les m&eacute;dicaments qui n&rsquo;englobent pas tous les domaines, les polyvalences possibles du m&eacute;dicament, ou les pr&eacute;cautions. Les renseignements sur le site ne peuvent &ecirc;tre utilis&eacute;s pour un traitement personnel et un diagnostic personnel. Toute instruction sp&eacute;cifique pour un patient particulier devrait &ecirc;tre consult&eacute;e avec votre conseiller de soins de sant&eacute; ou votre m&eacute;decin responsable du cas. Nous refusons toute r&eacute;f&eacute;rence au caract&egrave;re ind&eacute;niable de ces renseignements et des erreurs qu'ils pourraient contenir. Nous ne sommes pas responsables de tout dommage direct ou indirect, sp&eacute;cial ou d&rsquo;autre dommage &agrave; la suite de toute utilisation des renseignements sur ce site et &eacute;galement pour les cons&eacute;quences de l&rsquo;auto-traitement.</p>";s:13:"full_descr_es";s:5276:"<p><strong>Propiedades<br /></strong><br />&nbsp;El Sildenafil es el principio activo de Cenforce&nbsp;Professional.<br /> El Sildenafil controla la respuesta a la estimulaci&oacute;n sexual. Act&uacute;a aumentando la relajaci&oacute;n del m&uacute;sculo liso por medio del &oacute;xido n&iacute;trico, una sustancia qu&iacute;mica que se emite normalmente como respuesta a la estimulaci&oacute;n sexual. La relajaci&oacute;n del m&uacute;sculo liso deja el aumento de circulaci&oacute;n de la sangre en lugares espec&iacute;ficos en el pene lo que contribuye a la erecci&oacute;n.<br /> El Sildenafil se emplea para tratar la disfunci&oacute;n er&eacute;ctil (impotencia) en los hombres y para el tratamiento de la hipertensi&oacute;n arterial pulmonar.<br /> El Sildenafil se puede emplear adem&aacute;s para los prop&oacute;sitos no cubiertos por el presente prospecto m&eacute;dico.<br /><br /> <strong>Posolog&iacute;a y forma de administraci&oacute;n</strong><br /><br /> Cenforce Professional se se administra a demanda a 15-20 minutos aproximadamente antes de la actividad sexual. No tome Cenforce&nbsp;Professional m&aacute;s que una vez al d&iacute;a.<br /> Los alimentos con mucha grasa pospondr&aacute;n el efecto del f&aacute;rmaco.<br /> No tome pomelas ni el zumo de pomelo durante el per&iacute;odo que se pase el tratamiento con este f&aacute;rmaco.<br /><br /> <strong>Precauciones</strong><br /><br /> Antes de empezar a administrar el Sildenafil, aviselo al m&eacute;dico o al farmac&eacute;utico en caso de ser al&eacute;rgico al principio activo o si se padezca otras alerg&iacute;as.<br /> Es probable que los ancianos fueran m&aacute;s hipersensibles a los efectos secundarios del f&aacute;rmaco.<br /><br /> <strong>Contraindicaciones</strong><br /><br /> Cenforce Professional est&aacute; contraindicado en los pacientes que administren otras medicaciones para tratar la impotencia o empleen el f&aacute;rmaco contra el dolor en el pecho o los problemas card&iacute;acos.<br /> La medicaci&oacute;n no debe administrarse en las mujeres ni los menores de edad tampoco en los pacientes con una hipersensibilidad reconocida a cualquier excipiente del comprimido.<br /><br /> <strong>Reacciones adversas posibles</strong><br /><br /> Los efectos colaterales m&aacute;s communes ser&aacute;n el dolor de la cabeza, la rubefacci&oacute;n, pirosis, dispepsia, congesti&oacute;n de la nariz, la sensaci&oacute;n de vah&iacute;do, los mareos o diarrea.<br /> Hay poca probabilidad de padecer una alerg&iacute;a grave a esa medicaci&oacute;n, sin embargo en caso contrario busque la asistencia m&eacute;dica de urgencia. <br /> La mayor&iacute;a de los que administran el f&aacute;rmaco no sufren ningunos problemas graves.<br /> Si se enfrenta con unas reacciones fuera de las mencionadas, consulte al m&eacute;dico o al farmac&eacute;utico.<br /><br /> <strong>Interacci&oacute;n con otros medicamentos</strong><br /><br /> Este f&aacute;rmaco no debe administrarse concomitantemente con los nitratos y las drogas recreativas llamadas "poppers" que contienen amilo o nitrito de butilo; con los alfabloqueantes; otras medicaciones contra la impotencia; los medicamentos contra hipertensi&oacute;n, etc.<br /> Para obtener m&aacute;s informaci&oacute;n consulte al m&eacute;dico o al farmac&eacute;utico.<br /><br /> <strong>Dosis omitida</strong><br /><br /> Cenforce Professional se emplea a medida que sea necesario sin que se tuviera que seguir una administraci&oacute;n espec&iacute;fica.<br /><br /> <strong>Sobredosis</strong><br /><br /> En caso de emplear un exceso del f&aacute;rmaco se debe buscar la asistencia m&eacute;dica de modo inmediato. Los s&iacute;ntomas caracter&iacute;sticos de la sobredosis incluir&aacute;n el dolor en el pecho, las n&aacute;useas, la arritm&iacute;a cardiaca y una sensaci&oacute;n de vah&iacute;do o desmayo.<br /><br /> <strong>Almacenamiento</strong><br /><br /> Se debe almacenar a la temperatura interior entre 68 y 77 grados Fahrenheit (20 y 25 cent&iacute;grados) fuera de la luz de d&iacute;a y humedad excesiva. No debe conservarlo en el cuarto de ba&ntilde;o. Guarde todas las medicaciones fuera del alcance de los ni&ntilde;os y los animales dom&eacute;sticos.<br /><br /> <strong>Descargo de responsabilidades</strong><br /><br />&nbsp;Proveemos una informaci&oacute;n del car&aacute;cter general sobre los medicamentos sin intentar cubrir todas las recomendaciones, totalidad de los casos de interacci&oacute;n con otros medicamentos, tampoco todas las precauciones existentes. La informaci&oacute;n de la presente p&aacute;gina web no puede ser de utilidad en el autotratamiento ni el autodiagn&oacute;stico. Todas las recomendaciones espec&iacute;ficas para cada paciente individual deben arreglarse con el coordinador designado de la salud p&uacute;blica o con el m&eacute;dico encargado del caso cl&iacute;nico. Renunciamos de todas las responsabilidades por la fiabilidad del material provisto ni por errores que contenga. Nos descargamos de responsabilidad por los da&ntilde;os, sean que sean directos, indirectos, espec&iacute;ficos o dem&aacute;s da&ntilde;os que resulten de la aplicaci&oacute;n del contenido de la presente p&aacute;gina web ni que sean consecuencias del autotratamiento.</p>";s:13:"full_descr_it";s:4335:"<p><strong>Uso commune</strong><br /><br /> Sildenafil citrato &egrave; il componente principale di Cenforce Professional.<br /> Citrato di Sildenafil influisce sulla risposta alla stimolazione sessuale. Agisce aumentando rilassamento della muscolatura liscia con ossido nitrico, una sostanza chimica che &egrave; normalmente rilasciato in risposta alla stimolazione sessuale. Questo rilassamento della muscolatura liscia permette un aumento del flusso sanguigno in alcune aree del pene, che porta ad una costruzione.<br /> Sildenafil citrato &egrave; applicato per il trattamento della disfunzione erettile (impotenza) negli uomini e ipertensione arteriosa polmonare.<br /> Citrato di Sildenafil pu&ograve; essere utilizzato anche per altri scopi non elencate sopra.<br /><br /> <strong>Dosaggio e direzioni</strong><br /><br /> Cenforce Professional &egrave; preso circa 15-20 minuti prima dell'attivit&agrave; sessuale. Non prenda Cenforce pi&ugrave; di una volta al giorno.<br /> Un pasto ricco di grassi possono ritardare il tempo degli effetti di questa droga.<br /> Cercate di non mangiare pompelmo o succo di pompelmo bere mentre &egrave; in trattamento con Sildenafil.<br /><br /> <strong>Precauzioni</strong><br /><br /> Prima di iniziare a prendere il citrato di Sildenafil, informi il medico o il farmacista se siete allergici ad esso o se avete altre allergie.<br /> persone di et&agrave; possono essere pi&ugrave; sensibili agli effetti collaterali del farmaco.<br /><br /> <strong>Contraindactions</strong><br /><br /> Cenforce Professional &egrave; controindicato nei pazienti che assumono un altro farmaco per trattare l'impotenza o l'utilizzo di un farmaco per il nitrato di dolore toracico o problemi cardiaci.<br /> Questo medicinale non deve essere assunto da donne e bambini, cos&igrave; come in pazienti con ipersensibilit&agrave; nota ai componenti della tavoletta.<br /><br /> <strong>Possibili effetti collaterali</strong><br /><br /> Gli effetti indesiderati pi&ugrave; comuni sono mal di testa, rossore, bruciore di stomaco, disturbi di stomaco, naso chiuso, sensazione di testa vuota, capogiri o diarrea.<br /> Una grave reazione allergica a questo farmaco &egrave; molto rara, ma richiedere immediatamente assistenza medica se si verifica.<br /> Molte persone utilizzano questo farmaco non hanno gravi effetti collaterali.<br /> Nel caso in cui dovessero manifestarsi effetti collaterali non elencati sopra, contattare il medico o il farmacista.<br /><br /> <strong>Interazione farmacologica</strong><br /><br /> Questo farmaco non deve essere usato con i nitrati e droghe ricreative chiamato "poppers" contenenti nitrito di amile o di butile; farmaci alfa-bloccanti, farmaci per l'impotenza; medicinali per l'alta pressione arteriosa, ecc<br /> Consultare il proprio medico o farmacista per ulteriori dettagli.<br /><br /> <strong>Dose</strong><br /><br /> Cenforce Professional &egrave; utilizzato come necessario, quindi &egrave; improbabile che siano su un programma di dosaggio.<br /><br /> <strong>Overdose</strong><br /><br /> Se si pensa di aver usato troppo di questo medicinale rivolgersi ad un medico di emergenza subito. I sintomi di sovradosaggio di solito includono dolore al petto, nausea, battito cardiaco irregolare, e sensazione di testa leggera o svenimento.<br /><br /> <strong>Storage</strong><br /><br /> Conservare i farmaci a temperatura ambiente tra i 68-77 &deg; F (20-25 &deg; C) lontano dalla luce e dall'umidit&agrave;. Non conservare i farmaci in bagno. Conservare tutti i farmaci lontano dalla portata dei bambini e animali domestici.<br /><br /> <strong>Disclaimer</strong><br /><br /> Noi forniamo solo informazioni di carattere generale su farmaci che non copre tutte le direzioni, integrazioni farmacologiche, o precauzioni. Informazioni presso il sito non pu&ograve; essere utilizzato per l'auto-trattamento e di auto-diagnosi. Eventuali istruzioni specifiche per un particolare paziente deve essere concordato con il proprio consulente sanitario o medico incaricato del caso. Decliniamo l'affi